import React, { useState, useEffect } from "react";
import MainTrendItem from "./mainTrendItem";

function TrendContainer({ type, data, day }) {
  const [trendItem, setTrendItem] = useState(null);

  useEffect(async () => {
    if (day === "recent_list") {
      setTrendItem(
        data.recent_list.map((value) => {
          <MainTrendItem
            date={value.add_date}
            hashtag={value.hashtag}
            postCnt={value.post_cnt}
            checkStartTime={value.check_start_time}
          />;
        })
      );
    } else {
      setTrendItem(
        data[day].map((value) => {
          <MainTrendItem
            hashtag={value.hashtag}
            postGap={value.post_gap}
            postRate={value.post_rate}
            postCnt={value.post_cnt}
          />;
        })
      );
    }

    console.log("data!!!", data[day]);
  }, [day]);
  return <>{trendItem}</>;
}

export default TrendContainer;
